        "desc_it": "Lampada da tavolo, terra o parete/soffitto costituita da estruso in alluminio per la struttura e pressofusione di alluminio per la testa e lo snodo. Diffusore in policarbonato con perimetro luminoso e doppia serigrafia appositamente studiata per ottimizzare il fascio luminoso e ridurre l’abbagliamento. Fascio luminoso orientabile ottenuto da 1 modulo LED composto da 18 diodi. Potenza apparecchio da 8,5W (702lm) fino a 10W (526lm). Luce dimmerabile con CRI=90 per tutte le versioni (tranne versione P/B) con tecnologia STEP DIM a 5 regolazioni di intensità luminosa e luce di cortesia. Struttura rifinita con vernice poliacrilica in bianco, rosso, nero, ottone satinato o spazzolato e verniciato colore titanio. Testa rotante su 2 assi grazie a un doppio snodo. Miniaturizzazione del giunto a snodo con possibilità di regolarne la tenuta. Disponibili accessori nella versione C: morsetto, perno e braccio parete. Ideale per uffici, scrivanie, studi, zone notte. Descrizione tecnica: Apparecchio di illuminazione per installazione a parete in ambienti interni, con fascio orientabile. Staffa di fissaggio a parete in lamiera decapata con verniciatura poliacrilica. Struttura in alluminio estruso con verniciatura poliacrilica in colore bianco opaco, nero, rosso o titanio. Snodi in alluminio pressofuso con verniciatura poliacrilica. Tiranti in fune di acciaio. Testa orientabile su due assi, in alluminio pressofuso con verniciatura poliacrilica. Schermo diffusore in materiale acrilico sagomato con finitura satinata e doppia serigrafia. Pulsante per la regolazione dell'intensità luminosa secondo 5 livelli di comfort visivo. Fornito completo di cavo di alimentazione di lunghezza 1,6m (63\") con connettore jack e adattatore a spina.",
