_.each(listino_2020,function(nuovo){
    var id_nuovo_prodotto = nuovo["Articolo"].trim();
    
    var trovato_corrispondente_articolo_vecchio = false;

    
    
    _.each(listino_2019,function(vecchio){
        var id_vecchio_prodotto = vecchio["model_id"].trim();
        //_.log(id_vecchio_prodotto)
        
        if(id_nuovo_prodotto == id_vecchio_prodotto){
            trovato_corrispondente_articolo_vecchio =  true;

            var nuovo_prezzo = nuovo.Prezzo;
            var vecchio_prezzo = vecchio.price;
            
            if(nuovo_prezzo != vecchio_prezzo ){
                _.log(id_nuovo_prodotto+" ===== "+nuovo_prezzo+" - "+vecchio_prezzo)
                articoli_con_prezzo_cambiato++;
            }
            
        }
        
    });

    
    if( trovato_corrispondente_articolo_vecchio == false) {
        articoli_nuovi++;
        arr_nuovi_articoli.push(id_nuovo_prodotto);
    }
    
    


});

